Style: Stout - Milk / Sweet
By Tree House Brewing Company, Charlton, Massachusetts, USA üá∫üá∏
ABV: 7.7%
My rating: 4.8/5
Breakfast stouts are never a sin, but a compulsory item on a Saturday off. And here we are talking about a top one.
Pours dense, pitch black, little carbonation, a momentary tan head, ring legs afterwards. 
On the nose a lot of maple syrup, some roast barley, chocolate and coffee, intense and doesn't feel too sweet. Awesome.
Tastes a perfect balance of sweet and bitter, some roasted items (barley, coffee beans and cocoa nibs) for the bitterness, and a lot of maple syrup for the sweet side. 
Full bodied, velvety, booze heat, lingering flavours and a very long finish.
Very elegant beer, perfectly balanced and executed. Top!

